import React from 'react';
import {useEffect, useState} from "react";
import "./index.css"
import ConnectionVerifyAPI from "./API/ConnectionVerifyAPI";

function App() {

    const [isConnected, setIsConnected] = useState(false);

    useEffect(() => {
        const response = new ConnectionVerifyAPI();
        response.CheckProxy().then((value) => {
            setIsConnected(value);
        });
    }, []);

    if (isConnected) {
        return (
            <>
                <div>Hello World</div>
                <div></div>
            </>
        );
    } else {
        return (
            <div className="w-full h-full bg-f1loading"></div>
        );
    }
}

export default App;
